import { createStore } from 'redux';
import authReducer from './authReducer';

const loggedInState = {
    isLoggedIn: true,
    username: 'veli',
    displayName: undefined,
    image: null,
    password: 'admin'
};

const configureStore = () => {
    return createStore(authReducer, loggedInState);
}

export default configureStore;
